Para o curso Superior é preciso ter concluído o Ensino Médio ou equivalente. O aluno ingressará na Instituição: - Quando for classificado no Sisu (Sistema de Seleção Unificada) por meio do ENEM ou em processo seletivo próprio (vestibular).
- Apresentando todos os documentos exigidos em Edital;
- Assinando o Requerimento de Matrícula; Os editais aparecem no site http://bra.ifsp.edu.br/

Os casos e documentos que podem ser usados para pedir um abono de faltas são:

- Declaração de corporação militar, comprovando ausência;
- Comprovante de participação do estudante em reuniões da Comissão Nacional de Avaliação da educação superior (CONAES) em horário coincidente com as atividades acadêmica (Lei nº 10861/04);
- Declaração do Diretor-Geral do campus, comprovando que o estudante esteve representando o IFSP;
- Atestado médico para os casos previstos em lei.
- Certidão de óbito de parentes de 1º (primeiro) grau ou cônjuge;
- Solicitação judicial.

